 const Menudetail=(props)=>{
    console.log("")
    if(props.dish!=null)
    {
    
      
       return(
        <div className="row">
        <div className="col-12">
         <card>

            <cardImg width="100%" src={props.dish.image}>
            
            </cardImg>
            <cardBody>
<CardTitle>{props.dish.name}</CardTitle>
<cardText>{props.dish.description}</cardText>
            </cardBody>
         </card>
         </div>
         </div >
       )
    }
    else
    {
       return(<div></div>)
    }
    
 }

 
export default Menudetail;
